import React from "react";

function Icon(props){
 return  (
   <span className="my-tooltip" style = {{color: props.color, cursor: "pointer"}}>
      <i className ={props.typeIcon}></i>
      <span className="my-tooltiptext">{props.toolTipText}</span>
   </span>
);
};



export default Icon;
